I discovered this bug when currying a method named "watch" in Firefox.

Take this scenario:

``` javascript
const fn = curry(function watch(a, b) {...});
const fn2 = fn(true); // This will error in Firefox
```

This is the lodash code it is erroring on:

``` javascript
    /**
     * Gets the name of `func`.
     *
     * @private
     * @param {Function} func The function to query.
     * @returns {string} Returns the function name.
     */
    function getFuncName(func) {
      var result = (func.name + ''), // This is "watch" from the example
          // array is a function since Object.prototype contains a "watch" function in Firefox
          array = realNames[result],
          length = array ? array.length : 0;

      while (length--) {
        var data = array[length],
            otherFunc = data.func; // This errors because data is undefined.
        if (otherFunc == null || otherFunc == func) {
          return data.name;
