The #️⃣ emoji is composed of (like the other keycap emojis):
- a starting symbol, in this case `#`
- a `\uFE0F` variation selector
- a combining enclosing keycap `\u20E3`

`_.toArray` on a #️⃣ emoji returns an array of length two, with the first two items in index 0 and the combining enclosing keycap in index 1.

``` js
var _ = require('lodash');

console.log(_.toArray('5️⃣'));
//= [ '5️', '⃣' ]
console.log(_.toArray('#️⃣'));
//= [ '#️', '⃣' ]
console.log(_.toArray('*⃣'));
//= [ '*', '⃣' ]
```

I recently upgraded to v4 of lodash.merge, and some of the behavior seems to have changed:

``` javascript
var merge = require('lodash.merge');

var fn = function fn() {};
var obj = { obj: true };

var result = merge({}, { prop: fn }, { prop: obj });

console.log(result);
```

in v3, this outputs: `{ prop: { obj: true } }`
in v4, this outputs: `{ prop: { [Function: fn] obj: true } }` (i.e. the original `fn` function, which now has an added `obj` key)

To me, the v4 result is surprising: I would expect it just to replace `fn` with `obj` in the output, but instead it attempts to merge the function and the object together. It appears to do this by defining an extra property on the `fn` function itself, and returning the function. Is this the intended behavior?

In version 4, defaultsDeep doesn't handle assigning defaults functions in objects : 

``` js
'use strict';

let _ = require('lodash');

let a = {
  b: {
    c: x => 2 * x
  }
};

_.defaultsDeep(a, {
  b: {
    c: _.identity,
    d: _.identity
  }
});

console.log(a.b.c(1)); // 2 - OK
console.log(a.b.d(1)); // 2 - Meh, was expecting 1 :(
```

I believe this is linked to the use of `_.identity` (or perhaps it is simply because `b.c === b.d` in the source object) because using custom (and different) functions for `b.c` and `b.d` fixes it.

